products.description:
Нековзна гумова основа;

2-стороння ігрова поверхня;

Матер'яна поверхня, приємна на дотик;

Підвищує швидкість і точність у роботі та в грі.

Специфікація:

Товщина: 3 мм;

Розмір: 437 x 400 мм.

Опис Зовнішній акумулятор KLGO KP-89 20000 mAh Чорний

Підходить для підзарядки смартфонів, планшетів, навушників, розумних годин, ігрових консолей та інших невеликих гаджетів.

Спеціальний LED-індикатор точно показує, що залишився рівень заряду батареї, щоб ви могли визначити, коли потрібно підзарядити її.

Характеристики: Ємність акумулятора: 20000 мАч;

Максимальний струм: 2.1 А;

Тип батареї: Li-Ion;

Колір чорний;

Матеріал: пластик.

Canon i-SENSYS MF453DW — лазерний багатофункціональний пристрій, який допоможе підвищити продуктивність та ефективніше виконувати поставлені задачі. Він впорається із друком, скануванням та копіюванням документів.

Друкуючи файли на даному БФП, користувач отримає відбитки із високою якістю, чіткістю та високою стійкістю до вицвітання. Беззаперечна якість гарантується роздільною здатністю друку, яка складає 1200 x 1200 точок на дюйм. Лазерний кольоровий БФП оснащений сенсорним екраном, що дозволяє оперативно керувати необхідними функціями друку.

Основні особливості Canon i-SENSYS MF453DW:

- швидкість друку 38 сторінки у хвилину; 

- кольоровий сенсорний РК-дисплей;

- можливий двосторонній друк; 

- можливість підключення до бездротових мереж за допомогою програм Canon PRINT Business або AirPrint (iOS) і Mopria (Android);

- двостороннє однопрохідне сканування;

- функції захисту PIN-кодом, яка обмежує доступ до надрукованих конфіденційних документів.

Портативна зарядна станція OUKITEL P5000E з функцією ДБЖ з номінальною потужністю 2200 Вт, піковою потужністю 4000 Вт, вихідна напруга 200-240 В, чиста синусоїда. Вбудована акумуляторна батарея LiFePO4 потужністю 5120 Втг (51.2В/100Ач). Зарядна станція може одночасно заряджати до 15 пристроїв (завдяки вбудованим вихідним портам). Можливість заряджання станції від електромережі (вбудований зарядний пристрій 1800 Вт), від сонячних панелей максимальною потужністю 1000 Вт (придбати окремо), від прикурювача (зарядний кабель у комплекті) та від PD-адаптера живлення (купується окремо). Час заряду від мережі становить 3 години. Можливість заряджати до 15 пристроїв одночасно.

Кілька способів заряджання пристрою:


від електромережі за допомогою вбудованого зарядного пристрою – час заряджання становить 3 години;


від сонячних панелей максимальною потужністю 1000 Вт (купується окремо) – час заряджання становить 5 годин;


від електромережі та сонячних панелей – час зарядки 1.8 годин;


від автомобільної зарядки (кабель у комплекті);


за допомогою генератора (придбано окремо).


Режим роботи ДБЖ. Пристрій має режим байпасу, не вимагає безпосередньої роботи від акумулятора і може живитися безпосередньо від електромережі. Час перемикання на акумулятор становить 10 мс.
Вбудована акумуляторна батарея LiFePO4 у порівнянні з іншими має такі переваги, як швидша зарядка, підвищена кількість циклів заряду-розряду, низький саморозряд, великий ККД, невелика вага.
Швидка зарядка PD (Power Delivery) 100 Вт для підключених пристроїв - це технологія, що забезпечує швидке заряджання акумуляторів смартфонів і ноутбуків.
Система керування: вбудований MPPT-контролер для сонячних панелей та BMS-система для моніторингу та керування станом акумулятора.
LCD-дисплей для відображення стану зарядної станції та АКБ.
Установка Plug and Play легко встановити та під'єднати навіть непрофесіоналам.
Ящик зверху пристрою для зручного зберігання кабелів.
Міцні колеса та телескопічна ручка полегшують транспортування. Потужність влаштування номінальна 2200 Вт, пікова 4000 Вт.
Вбудована акумуляторна батарея LiFePO4 потужністю 5120 Вт (51.2В/100Ач), кількість циклів розряду-заряду АКБ ≥3500.
Вбудований зарядний пристрій 1800 Вт.

Вхідні та вихідні порти:


вхід постійної напруги (для сонячних панелей): 12-120В/15А з максимальною потужністю 1000 Вт;


вхід автомобільної зарядки: 12В/8А, 24В/10А;


вихід змінного струму (AC): 5 портів 200-240 В 2200 Вт, чиста синусоїда;


вихід постійної напруги (DC): 2 порти DC5521 12В/3А, 1 вихід автомобільної зарядки («прикурювач») 12В/10А, 1 авіаційний порт 24В/10А;


порти USB-A: 2 порти 5В/2.4А потужністю 12 Вт кожен, 2 порти 5 В/3 А, 9В/2А, 12 В/1.5 А потужністю 18 Вт кожен з підтримкою швидкої зарядки QC3.0;


порти USB-C: 2 порти PD 100 Вт 5 В/3 А, 9 В/3 А, 12 В/3 А, 15 В/3 А, 20 В/5 А.


Зарядна станція працює при температурі від 0 до +40 °C.

Габаритні розміри становлять 550/299/487 мм, вага 52 кг.
